CREATE TABLE perf ( \ git TEXT, \ test_name TEXT, \ seconds REAL, \ task_clock REAL, \ context_switches INTEGER, \ CPU_migrations INTEGER, \ page_faults INTEGER, \ cycles INTEGER, \ stalled_cycles_frontend INTEGER, \ stalled_cycles_backend INTEGER, \ instructions INTEGER, \ branches INTEGER, \ branch_misses INTEGER, \ L1_dcache_loads INTEGER, \ L1_dcache_load_misses INTEGER, \ LLC_loads INTEGER, \ LLC_load_misses INTEGER, \ PRIMARY KEY (git, test_name) \ )
